import React from 'react';

class  Greeting extends React.Component {
    render(){
    return (
        <div>
            <h1>Welcome {this.props.to}</h1>
            <h2>You recived the messeage from {this.Props.from}</h2>
        </div>
    )

    }
}

export default Greeting;
